          </div>
          <div className="col-md-2" />
        </div>
        <div className="row">
          <div className="col-md-2" />
          <div className="col-md-8">
            <div className="row">
              <div className="col-md-6 ce">
                <img src="https://placehold.co/590x400" />
                <div className="spacer50px" />
              </div>
              <div className="col-md-6 ce">
                <img src="https://placehold.co/590x400" />
                <div className="spacer50px" />
              </div>
            </div>
          </div>
          <div className="col-md-2" />
        </div>
        <Footer />
      </Container>
		);
	}
}
